import React from 'react';
import {Link} from 'react-router-dom'

import LinkHome from './Link/LinkHome'
import LinkFavorites from './Link/LinkFavorites'
import LinkExit from './Link/LinkExit'

function Header (props) {
  console.log(props.menuNavigationFavorites)
  return (
    <div className="header">
      <div className="logo">
      </div>
      <LinkHome
        menuNavigationHome={props.menuNavigationHome}
        changeHome={props.changeHome}
      />
      <LinkFavorites
        menuNavigationHome={props.menuNavigationFavorites}
        changeHome={props.changeFavorites}
      />
      <div>
      </div>
      <LinkExit
        exitApp={props.exitApp}
      />
      <div>
      </div>
    </div>
  )
}

export default Header
